import React from 'react';

class ToolBar extends React.Component {
  state = {};

  render() {
    return (
      <div className="tool-bar">
        <div className="left-tools">
          This is left
        </div>
        <div className="right-tools">
          This is right
        </div>
      </div>
    );
  }
}

export default ToolBar;
